import './App.css';

const App = () => {
  return (
    <div className="App">
      <h3 style={{fontFamily}}>اپلیکیشن مدیریت مخاطبین</h3>
      <button className='btn btn-primary data-bs-toggle'>Contact</button>
      <br />
      <span className='bx bxs-user'></span>
    </div>
  );
}

export default App;
